import { useEffect, useState } from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { getEnv, getDataUrl } from '../../api';
import './index.scss';


const GridLayout = () => {
    const [data, setData] = useState([]);

    const fetchGet = async () => {
        const data = await getDataUrl();
        setData(data);
    }

    useEffect(()=>{
        fetchGet();
    },[])
 
    return(
      <>
        <Row className='mt-5 row-style-custom'>
        <Col  className="col-style-custom" xs={12} md={6}>
            <strong>User:</strong>
        </Col>
        <Col  className="col-style-custom" xs={12} md={6}>Correo:</Col>
        <Col  className="col-style-custom" xs={12} md={12}>Titulo</Col>
        <Col  className="col-style-custom" xs={12} md={12}>Body: </Col>
        </Row>
      </>
    )
}

export default GridLayout
